import React from 'react';
import logo from './logo.svg';
import './App.css';
import Dashboard from './containers/Dashboard';

function App() {

  const dashboard = (
    <Route path={Dashboard} exact>
      <Dashboard />
    </Route>
  )

  const journal = (
    <Route path={JournalPage}>
      <JournalPage />
    </Route>
  )
  return (
    <Router>
      <AppBar />
      <Switch>
        {dashboard}
        {journal}
      </Switch>
    </Router>
  )
